window.bookSummaryJSON = "<p>The devil is taking his matchmaking to the next level with the introduction of <i>Grim Dating</i>. The grim reapers he drafts to work in his new agency are dying to help their clients fall in love.</p> <p>Includes previously released titles:</p> <ul> <li><i>Pushing Up Posies</i>: <i>\"</i>Netflix and chill\" takes on a whole new meaning when Posie starts dating the reaper.</li> <li><i>Sweeping Ashley</i>: A witch is about to learn love is sometimes messy when a reaper finds her match.</li> <li><i>Contempt of Kourtney</i>: This lawyer didn’t mean to fall for her client, but love doesn’t always follow the law.</li> <li><i>Knocking on Helen’s Door</i>: Seducing angels is forbidden, but this reaper is hoping Heaven and Hell will make an exception for love.</li> </ul>"; 
